CREATE TABLE Users (
                       Id VARCHAR(255) PRIMARY KEY,
                       Name VARCHAR(255),
                       Lastname VARCHAR(255),
                       Password VARCHAR(255),
                       CreationDate TIMESTAMP,
                       BasketId VARCHAR(255)
);
CREATE TABLE Basket (
                        Id VARCHAR(255) PRIMARY KEY,
                        UserId VARCHAR(255),
                        TotalPrice DECIMAL,
                        FOREIGN KEY (UserId) REFERENCES Users(Id),
                        CountMap JSONB,
                        ItemsMap JSONB
);
CREATE TABLE Product (
                         Id VARCHAR(255) PRIMARY KEY,
                         Price DECIMAL,
                         IsSold BOOLEAN,
                         CreationDate TIMESTAMP,
                         SoldDate TIMESTAMP,
                         Name VARCHAR(255),
                         Description TEXT,
                         Categories TEXT[],
                         Material VARCHAR(255)
);




